// src/components/About.js
import React from 'react';
import { motion } from 'framer-motion';

const stats = [
  { label: 'Years Experience', value: '5+' },
  { label: 'Projects Delivered', value: '15+' },
  { label: 'Model Accuracy', value: '99.2%' }
];

const skills = [
  'Machine Learning', 'Deep Learning', 'NLP', 'LLMs',
  'MLOps', 'Data Engineering', 'Time Series', 'Reinforcement Learning'
];

const About = ({ isVisible }) => {
  return (
    <section
      id="about"
      className={`section-padding bg-gray-50 dark:bg-gray-800 transition-all duration-700 ${
        isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'
      }`}
    >
      <div className="container mx-auto px-4">
        <h2 className="section-title">About Me</h2>
        <p className="text-center text-gray-600 dark:text-gray-300 mb-16 max-w-3xl mx-auto">
          Building AI solutions that deliver measurable business value
        </p>

        <div className="flex flex-col lg:flex-row gap-12 items-start">

          {/* LEFT SIDE - Stats + Skills */}
          <div className="lg:w-2/5 flex flex-col gap-10">

            {/* Stats Cards */}
            <div className="grid grid-cols-3 gap-4">
              {stats.map((stat, index) => (
                <motion.div
                  key={index}
                  className="bg-white dark:bg-gray-700 p-4 rounded-xl shadow-md text-center"
                  initial={{ opacity: 0, y: 10 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.6, delay: index * 0.2 }}
                >
                  <p className="text-2xl font-bold text-primary-600 dark:text-primary-400">
                    {stat.value}
                  </p>
                  <p className="text-gray-600 dark:text-gray-300 text-sm">{stat.label}</p>
                </motion.div>
              ))}
            </div>

            {/* Skills as Animated Tags */}
            <div className="bg-white dark:bg-gray-700 rounded-xl p-6 shadow-md">
              <h4 className="text-lg font-bold mb-4 text-center">Core Skills</h4>
              <motion.div
                className="flex flex-wrap gap-3 justify-center"
                initial="hidden"
                animate="visible"
                variants={{
                  visible: { transition: { staggerChildren: 0.08 } }
                }}
              >
                {skills.map((skill, i) => (
                  <motion.span
                    key={i}
                    className="px-4 py-2 bg-primary-100 dark:bg-primary-900/30 text-primary-800 dark:text-primary-200 text-sm font-medium rounded-full shadow-sm"
                    variants={{
                      hidden: { opacity: 0, y: 10 },
                      visible: { opacity: 1, y: 0 }
                    }}
                  >
                    {skill}
                  </motion.span>
                ))}
              </motion.div>
            </div>
          </div>

          {/* RIGHT SIDE - About Text */}
          <div className="lg:w-3/5">
            <h3 className="text-2xl font-bold mb-4 text-primary-600 dark:text-primary-400">
              Senior Machine Learning Engineer
            </h3>
            <p className="mb-6 text-gray-700 dark:text-gray-300">
              With 5+ years of experience in AI/ML, I specialize in developing NLP systems,
              Large Language Models, and predictive analytics. My focus is on building
              production-ready ML solutions that optimize performance and deliver tangible ROI.
            </p>

            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="flex items-start">
                <div className="bg-primary-100 dark:bg-primary-900/50 p-3 rounded-lg mr-4">
                  <svg className="w-6 h-6 text-primary-600 dark:text-primary-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12l2 2 4-4m5.618-4.016A11.955 11.955 0 0112 2.944a11.955 11.955 0 01-8.618 3.04A12.02 12.02 0 003 9c0 5.591 3.824 10.29 9 11.622 5.176-1.332 9-6.03 9-11.622 0-1.042-.133-2.052-.382-3.016z"></path>
                  </svg>
                </div>
                <div>
                  <h4 className="font-bold text-lg mb-1">Key Achievements</h4>
                  <p className="text-gray-600 dark:text-gray-400">
                    Reduced inference latency by 70% in LLM pipelines for enterprise clients.
                  </p>
                </div>
              </div>

              <div className="flex items-start">
                <div className="bg-primary-100 dark:bg-primary-900/50 p-3 rounded-lg mr-4">
                  <svg className="w-6 h-6 text-primary-600 dark:text-primary-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M13 10V3L4 14h7v7l9-11h-7z"></path>
                  </svg>
                </div>
                <div>
                  <h4 className="font-bold text-lg mb-1">Current Focus</h4>
                  <p className="text-gray-600 dark:text-gray-400">
                    Building scalable LLM solutions and optimizing inference for edge deployment.
                  </p>
                </div>
              </div>
            </div>

          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
